import React from 'react';
import './Contact.css'

function Contact() {
    return (
        <div className="contact-page">
            <h1>Lets Connect</h1>
            <h2>If you would like to reach out to me directly, just send me a direct message by clicking on the button below. I can also be reached through social media.</h2>
            <button>Talk to me</button>
        </div>
    )
}

export default Contact
